import React from "react";
import {
  AppBar,
  Container,
  Toolbar,
  IconButton,
  Box,
  Typography,
  Button,
} from "@mui/material";

const Navbar = () => {
  return (
    <>
      <AppBar sx={{ bgcolor: "black" }}>
        <Container>
          <Toolbar>
            <Box>
              <Button
                variant="contained"
                style={{ backgroundColor: "white", color: "black" }}
              >
                HOME
              </Button>
            </Box><Box>
              <Button
                variant="contained"
                style={{ backgroundColor: "white", color: "black" }}
              >
                HOME
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
    </>
  );
};

export default Navbar;
